import React from "react";
import HeaderLink from "./HeaderLink";
import style from "./HeaderBody.module.css";

function HeaderBody() {
  return (
    <div className={style.list}>
      <HeaderLink name="Normal" />
      <HeaderLink name="Good" style={{color,before: 'red'}}/>
      <HeaderLink name="Busy" />
      <HeaderLink name="Hot" />
      <HeaderLink name="Upkeep" />
    </div>
  );
}

export default HeaderBody;
